const FOV = Math.PI/2;
const ZFAR = 1000;
const ZNEAR = 0.1;
const Q = ZFAR/(ZFAR-ZNEAR);
const F = 1/Math.tan(FOV/2);


canv = document.querySelector('canvas');
canv.width  = 1600;
canv.height = 900;
const ASPECT_RATIO = canv.height / canv.width;

c = canv.getContext('2d');
c.imageSmoothingEnabled = false;

function MultiplyMatrixVector(i, m)
{
    _x = i.x * m[0][0] + i.y * m[1][0] + i.z * m[2][0];
    _y = i.x * m[0][1] + i.y * m[1][1] + i.z * m[2][1];
    _z = i.x * m[0][2] + i.y * m[1][2] + i.z * m[2][2];
    if (m[0].length >= 3)
    {
        w   = i.x * m[0][3] + i.y * m[1][3] + i.z * m[2][3];
        if (w != 0)
        {
            _x /= w;
            _y /= w;
        }
    }
    return {x: _x, y: _y, z: _z}
}

projectionMatrix = 
[
    [ASPECT_RATIO * F, 0, 0, 0],
    [0, F, 0, 0],
    [0, 0, Q, 1],
    [0, 0, -ZNEAR * Q, 0]
];


class Vector3f {
    constructor(x, y, z)
    {
        this.x = x;
        this.y = y;
        this.z = z;
    }
}

camera = new Vector3f(0, 0, 0);

function addVector3f(a, b)
{
    return {x: a.x + b.x, y: a.y + b.y, z: a.z + b.z};
}

function subVector3f(a, b)
{
    return {x: a.x - b.x, y: a.y - b.y, z: a.z - b.z};
}

class Triangle {
    constructor(a, b, c, _color)
    {
        this.color = _color == null ? "blue" : _color;
        this.p = [a, b, c];
    }
}

function drawTriangle(triangle, width)
{
    c.strokeStyle = "red";
    c.fillStyle = triangle.color;
    c.lineWidth = width;
    c.beginPath();
    c.moveTo(triangle.p[0].x, triangle.p[0].y);
    c.lineTo(triangle.p[1].x, triangle.p[1].y);
    c.lineTo(triangle.p[2].x, triangle.p[2].y);
    c.lineTo(triangle.p[0].x, triangle.p[0].y)
    c.fill();
    //c.stroke();
}


class Mesh {
    constructor()
    {
        this.verts = [];
    }

    addVert(_vert)
    {
        this.verts.push(_vert);
    }
}

lightSource = new Vector3f(0, 0, -1);

objects = [];
class Object {
    constructor(x, y, z, _mesh)
    {
        this.position = {x: x, y: y, z: z};
        this.rotation = {x: 0, y: 0, z: 0};
        this.mesh = _mesh;
        this.movingx = Math.random() * 2 - 1;
        this.movingy = Math.random() * 2 - 1;
        this.movingz = Math.random() * 2 - 1;
        this.rotationSpeed = Math.random()  * 2 - 1;

        objects.push(this);
    }

    addMesh(_mesh) 
    {
        this.mesh = _mesh;
    }

    update()
    {
        
        this.position.x += this.movingx * deltaTime;
        this.position.y += this.movingy * deltaTime;
        this.position.z += this.movingz * deltaTime;
        
        //this.rotation.z += this.rotationSpeed * deltaTime;
        if(this.rotation.z >= 2*Math.PI) this.rotation.z = 0;
        this.rotation.y += (this.rotationSpeed + 0.01) * deltaTime;
        if(this.rotation.y >= 2*Math.PI) this.rotation.y = 0;
        //this.rotation.x += (this.rotationSpeed + 0.01) * deltaTime;
        if(this.rotation.x >= 2*Math.PI) this.rotation.x = 0;
    }

    draw()
    {
        this.triRotated    = new Triangle((new Vector3f(0, 0, 0), new Vector3f(0, 0, 0), new Vector3f(0, 0, 0)));
        this.triTranslated = new Triangle((new Vector3f(0, 0, 0), new Vector3f(0, 0, 0), new Vector3f(0, 0, 0)));
        this.triProjected  = new Triangle((new Vector3f(0, 0, 0), new Vector3f(0, 0, 0), new Vector3f(0, 0, 0)));

        this.normalVector  = new Vector3f(0, 0, 0);
        this.dotProduct    = 0;
        
        this.mesh.verts.forEach(triMain => {
            for (var i = 0; i < 3; i++)
            {
                this.movedVector = subVector3f(triMain.p[i], camera);
                this.triRotated.p[i] = {x: (this.movedVector.x * Math.cos(this.rotation.z))     - (this.movedVector.y * Math.sin(this.rotation.z)), y: (        this.movedVector.x * Math.sin(this.rotation.z)) + (        this.movedVector.y * Math.cos(this.rotation.z)), z:         this.movedVector.z};
                this.triRotated.p[i] = {y: (this.triRotated.p[i].y * Math.cos(this.rotation.x)) - (this.triRotated.p[i].z * Math.sin(this.rotation.x)), z: (this.triRotated.p[i].y * Math.sin(this.rotation.x)) + (this.triRotated.p[i].z * Math.cos(this.rotation.x)), x: this.triRotated.p[i].x};
                this.triRotated.p[i] = {z: (this.triRotated.p[i].z * Math.cos(this.rotation.y)) - (this.triRotated.p[i].x * Math.sin(this.rotation.y)), x: (this.triRotated.p[i].z * Math.sin(this.rotation.y)) + (this.triRotated.p[i].x * Math.cos(this.rotation.y)), y: this.triRotated.p[i].y};
            
                this.triTranslated.p[i] = addVector3f(this.triRotated.p[i], this.position);
            }

            this.line1 = new Vector3f(this.triTranslated.p[1].x - this.triTranslated.p[0].x, this.triTranslated.p[1].y - this.triTranslated.p[0].y, this.triTranslated.p[1].z - this.triTranslated.p[0].z);
            this.line2 = new Vector3f(this.triTranslated.p[2].x - this.triTranslated.p[0].x, this.triTranslated.p[2].y - this.triTranslated.p[0].y, this.triTranslated.p[2].z - this.triTranslated.p[0].z);

            this.normalVector.x = this.line1.y * this.line2.z - this.line2.y * this.line1.z;
            this.normalVector.y = this.line1.z * this.line2.x - this.line2.z * this.line1.x;
            this.normalVector.z = this.line1.x * this.line2.y - this.line2.x * this.line1.y;

            this.l = Math.sqrt(this.normalVector.x*this.normalVector.x + this.normalVector.y*this.normalVector.y + this.normalVector.z*this.normalVector.z);
            this.normalVector.x /= this.l; this.normalVector.y /= this.l; this.normalVector.z /= this.l;

            this.dotProduct = (this.normalVector.x * (this.triTranslated.p[0].x - camera.x)) + (this.normalVector.y * (this.triTranslated.p[0].y - camera.y)) + (this.normalVector.z * (this.triTranslated.p[0].z - camera.z));

            if (this.dotProduct < 0)
            {
                this.lightLength = Math.sqrt(lightSource.x*lightSource.x + lightSource.y*lightSource.y + lightSource.z*lightSource.z);
                lightSource.x /= this.lightLength; lightSource.y /= this.lightLength; lightSource.z /= this.lightLength;

                this.lightDot = (this.normalVector.x * lightSource.x) + (this.normalVector.y * lightSource.y) + (this.normalVector.z * lightSource.z);

                for (var i = 0; i < 3; i++)
                {                
                    this.triProjected.p[i] = MultiplyMatrixVector(this.triTranslated.p[i], projectionMatrix);
                    this.triProjected.p[i].x = (this.triProjected.p[i].x + 1) * 0.5 * canv.width;
                    this.triProjected.p[i].y = (this.triProjected.p[i].y + 1) * 0.5 * canv.height; 
                }
                this.lightDot += 0.99;
                this.triProjected.color = `rgb(${100 * this.lightDot}, ${255 * this.lightDot}, ${255 * this.lightDot})`;
                //this.triProjected.color = triMain.color;
                drawTriangle(this.triProjected, 1);
            }
        });
    }
}

