let prev = Date.now(), cur, deltaTime;
function Update()
{
    cur = Date.now();
    deltaTime = (cur - prev)/1000;
    prev = cur;
    
    c.fillStyle = 'black';
    c.fillRect(0, 0, canv.width, canv.height);

    objects.forEach(object => {
        object.update();
        object.draw();
    });
    requestAnimationFrame(Update);
}

var moveSpeed = 10;
document.addEventListener("keydown", (event) => {
    console.log(event.key);
    switch (event.key)
    {
        case "ArrowUp":
            camera.z += 5 * deltaTime;
            break;
        case "ArrowDown":
            camera.z -= 5 * deltaTime;
            break;
        case "ArrowLeft":
            camera.x -= 5 * deltaTime;
            break;
        case "ArrowRight":
            camera.x += 5 * deltaTime;
            break;
    }
});

Update();